var VPSC_AVT_Default='<a href="http://vgo.upsilos.com/youtube" target="_blank"><img style="width:300px;height:250px" src="http://voltex.upsilos.com/files/voltexpixel_youtube.jpg" /></a>',VPSC_AVT_Code=new Array;function VPSC_AVT_Banner(e,o){VPSC_AVT_Code.push('<a href="'+e+'" target="_blank"><img style="width:300px;height:250px" src="'+o+'"/></a>')}function VPSC_AVT_Iframe(e){VPSC_AVT_Code.push('<iframe src="'+e+'" scrolling="no" style="width:300px;height:250px;border:0px;padding:0;overflow:hidden" allowtransparency="true" sandbox="allow-forms allow-popups allow-pointer-lock allow-same-origin allow-scripts"></iframe>')}function VPSC_AVT(){VPSC_AVT_Code.push(VPSC_AVT_Default);var e=parseInt(100*Math.random())%VPSC_AVT_Code.length,o=VPSC_AVT_Code[e];document.write(o)}
/* VPSC Library (http://vpsc.upsilos.com/) - JavaScript / Cookie.js */
function VPSC_Cookie_Set(cname,cvalue,exdays){var d=new Date();d.setTime(d.getTime()+(exdays*24*60*60*1000));var expires="expires="+d.toUTCString();document.cookie=cname+"="+cvalue+";"+expires+";path=/"}function VPSC_Cookie_Get(cname){var name=cname+"=";var ca=document.cookie.split(';');for(var i=0;i<ca.length;i+=1){var c=ca[i];while(c.charAt(0)==' '){c=c.substring(1)}if(c.indexOf(name)==0){return c.substring(name.length,c.length)}}return ""}
/* VPSC Library (http://vpsc.upsilos.com/) - JavaScript / GetURLParam.js */
function VPSC_GetURL_Vars(){var n={};window.location.href.replace(/[?&]+([^=&]+)=([^&]*)/gi,function(r,e,t){n[e]=t});return n}function VPSC_GetURL_Param(n,r){var e=r;return window.location.href.indexOf(n)>-1&&(e=VPSC_GetURL_Vars()[n]),e}
/* VPSC Library (http://vpsc.upsilos.com/) - JavaScript / ReadTextFile.js */
function VPSC_ReadTextFile(file,callback){var rawFile=new XMLHttpRequest();rawFile.overrideMimeType("application/json");rawFile.open("GET",file,true);rawFile.onreadystatechange=function(){if(rawFile.readyState===4&&rawFile.status=="200"){callback(rawFile.responseText)}};rawFile.send(null)}